    const [state, setState] = useState({
        title: '', 
        artist: '', 
        description: '', 
        images: '', 
        id: '', 
        alt: ''
    })



    if(map){
        map.flyTo({
            center: [-105.43647766113281, 37.41816326969145],
            zoom: 12,
            speed: 1,
            padding: {left: 500 },
        });

    }

    console.log(projects.features[12].properties)

